// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './Header';
import Sidebar from './Sidebar';
import DashboardContent from './DashboardContent';
import ThreeDSimulation from './T3DSimulation';
import ObjectRecognition from './OR';
import NUCConnection from './NUC';

const App = () => {
  return (
    <Router>
      <div className="flex h-screen bg-gray-100">
        <Sidebar />
        <div className="flex-1 flex flex-col">
          <Header />
          <Switch>
            <Route path="/DashboardContent" exact component={DashboardContent} />
            <Route path="/ThreeD" component={ThreeD} />
            <Route path="/OR" component={OR} />
            <Route path="/NUC" component={NUC} />
          </Switch>
        </div>
      </div>
    </Router>
  );
};

export default App;
